-- ESTADOS

CREATE TABLE sh_localidadeUf (
	id 			INT(11) NOT NULL,
	idPais 		INT(11) NOT NULL,
	sigla 		CHAR(2) NOT NULL,
	nome 		VARCHAR(128) NOT NULL,
	  
	PRIMARY KEY (id),
	UNIQUE KEY SH_LOCALIDADEUF_SIGLA_UNIQUE (sigla)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


-- CIDADES
CREATE TABLE sh_localidadeCidade (
  id 			INT(11) NOT NULL,
  idUf 			INT(11) NOT NULL,
  nome 			VARCHAR(256) NOT NULL,
  
  PRIMARY KEY (id),
  KEY SH_LOCALIDADECIDADE_ESTADO_FK (idUf),
  CONSTRAINT SH_LOCALIDADECIDADE_ESTADO_FK FOREIGN KEY (idUf) REFERENCES sh_localidadeUf (id) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- BAIRROS
CREATE TABLE sh_localidadeBairro (

	id		VARCHAR(36) NOT NULL,
	idUf		INT NOT NULL,
	idCidade	INT NOT NULL,
	nome		VARCHAR(256) NOT NULL,
	
	CONSTRAINT SH_LOCALIDADEBAIRRO_PK PRIMARY KEY (id),
	CONSTRAINT SH_LOCALIDADEBAIRRO_UF_FK FOREIGN KEY (idUf) REFERENCES sh_localidadeUf (id),
	CONSTRAINT SH_LOCALIDADEBAIRRO_CIDADE_FK FOREIGN KEY (idCidade) REFERENCES sh_localidadeCidade (id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

















